import './App.css';
import Header from './components/Header';
import Home from './pages/home';
import Canvas from './pages/canvas';
import Button from './components/button';
import {useNavigate} from 'react-router-dom';

function App() {
  const nav = useNavigate();

  function newCanvas(){
    nav("/canvas");
  }

  return (
    <div className="App">
      <Header title="Doodly"/>
      <div id="choice">
        <Routes path="/" element={<Home />} />
        <Routes path="/canvas" element={<Canvas />} />
        <Button clicked={() => newCanvas()} title="New Canvas"/>
        <Button title="Load Canvas"/>
      </div>
    </div>
  );
}

export default App;
